import { useEffect } from "react";
import Landing from "./landing";
import Signin from "./auth/signIn";
import Messener from "./messenger/index";
import { CookiesProvider } from "react-cookie";
import { useCookies } from "react-cookie";

export default function Home() {
  const [cookies, getCookie] = useCookies(["credentials"]);
  const auth = true;
  useEffect(() => {
    getCookie("credentials");
    console.log("cookies", cookies.credentials);
  }, []);
  return <CookiesProvider>{auth ? <Signin /> : <Messener />}</CookiesProvider>;
}
